import React from 'react';
import { View, Text, StyleSheet, Image } from 'react-native';


const DataUser={
    name:"Juan",
    lastName:"Pérez",
    sexo:"Masculino",
    email:"jsi@hotmail.com",
    telf:"09898765465",
    ciudad:"Quito"

}

export default function Account(props) {
    return (
        <View style={styles.container}>
            <View>
                <View style={styles.contentImage}>
                    <Image
                        style={styles.image}
                        source={require('./../assets/usuario.jpg')}
                        resizeMode='contain'
                    />
                </View>
                <View data={DataUser}>
                    <Text style={styles.info}>Nombre: </Text><Text>{DataUser.name}</Text>
                    <Text style={styles.info}>Apellido: {DataUser.lastName}</Text>
                    <Text style={styles.info}>Sexo: {DataUser.sexo}</Text>
                    <Text style={styles.info}>Email: {DataUser.email}</Text>
                    <Text style={styles.info}>Número de telefono: {DataUser.telf}</Text>
                    <Text style={styles.info}>Ciudad: {DataUser.ciudad}</Text>
                </View>
            </View>
        </View>
    );
}
const styles = StyleSheet.create({
    container: {
        flex: 1,
        padding: 20
    },
    contentImage: {
        alignItems: 'center'
    },
    info: {
        fontSize: 20,
        lineHeight:30,
        flexDirection:"row"
    },
    image: {
        width: 200,
        height: 200,
        borderRadius: 160,
    }

})
